        {
            user2Choose = decisionofRockPaperScissors;
        }
        else
        {
            revert ("Please entey 1, 2 or 3");
        }
    }
    //logic checking
    // 1 = Rock 2 = Paper 3 = Scissoes
    function logicCheck () view external returns (string memory){
        if(user1Choose == 1){
            if(user2Choose == 1)
                return ("Tie");
            if(user2Choose == 2)
                return ("User2 Win!");
            else
                return ("User1 Win!");
        }
        if(user1Choose == 2){
            if(user2Choose == 2)
                return ("Tie");
            if(user2Choose == 3)
                return ("User2 Win!");
            else
                return ("User1 Win!");
        }
        if(user1Choose == 3){
            if(user2Choose == 3)
                return ("Tie");
            if(user2Choose == 1)
                return ("User2 Win!");
            else
                return ("User1 Win!");
        } 

        return ("something wrong");
    }

}

